appControllers.controller('yunying-share-register', function($scope) {
	$scope.title = '分享注册';
	$scope.username=userBo.userName;
	var swiper = new Swiper('.swiper-container', {
	        pagination: '.swiper-pagination',
	        paginationClickable: true,
	        direction: 'vertical'
	    });
	$scope.share = function() {
        $scope.url = "http://z.haoma.cn/tms-weixin-war/shareRegisterWechat/toRegister?username=" + $scope.username;
        cordova.plugins.sharePlugin.share({
            title:"推广注册",
            description:"做号码之家代理，快速切入通讯领域，进军十三亿消费大市场",
    		image:"",
            url:$scope.url,
            category:"2"
        });
    }
});
